function ArrayComponent() {
    const [Datas, setDatas] = useState([
        'test1',
        'test2'
    ])

    return <>
        <ul>
            {
                Datas.map((vale) => {
                    console.log(vale);

                    <li>{vale}</li>
                })
            }
        </ul>
    </>
}
export default ArrayComponent
